import React from 'react';
import Snake from './Snake';

function App() {
  state = {
    snakeDot: [
      [0, 0],
      [2, 0]
    ]
  }
  render(); {
    return (
      <div className="game-area">
        <Snake snakeDots={this.state.snakeDots} />
      </div >
    );
  }
}
export default App;
